// 메인화면
import React from 'react'; // 넥스트 안해도 됨. 알아서 처리
import Head from 'next/head';
import Link from 'next/link'; // 링크 추가하기
import AppLayout from '../componetns/AppLayout';

const Home = () => {
    return(
        <div>
            <head>
                <title>NodeBirds</title>
                <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.26.11/antd.css"></link>
                <script src="https://cdnjs.cloudflare.com/ajax/libs/antd/3.26.11/antd.js"></script>
            </head>
            <AppLayout>
                <Link href="/about"><a>About</a></Link>
            </AppLayout>
        </div>
    )
}

export default Home;
